import React from 'react';
import { Switch, Route } from 'react-router-dom';
import About from './About.js';

export default () => {
  const { loading, user } = useAuth0();

  return (
    <main>
      <Switch>
        <Route exact path="/about" component={About} />
      </Switch>
    </main>
  );
};
